import React from 'react';

import self from '../img/self.png';

let colors = "rgb(185, 85, 211), rgb(247, 10, 7)";
// use gradient generator to get this

export const info = {
    firstName: "John",
    initials: "js",
    position: "Full Stack Developer",
    selfPortrait: self,
    gradient: `linear-gradient(135deg, ${colors})`,
    miniBio: [
        ["☕️", "Fueled by coffee"],
        ["🇺🇸", "Based in the US"],
        ["💼", "Systems Engineer at Google"],
        ["✉️", "johnsmith@gmail.com"],
    ],
    socials: [
        ["https://facebook.com/", facebookIcon()],
        ["https://instagram.comn/", instagramIcon()],
    ]
}

function facebookIcon() { <i className="fa fa-facebook" aria-hidden="true" />};

function instagramIcon() { <i className="fa fa-instagram" aria-hidden="true" />};
